/******************************************************************************
function :	Initialize the e-Paper register
parameter:
 ******************************************************************************/
unsigned char EPD_Init(unsigned char update)
{
	unsigned char count;
	EPD_Reset();

	if(update == FULL_UPDATE) {
		EPD_WaitUntilIdle();
		EPD_SendCommand(0x12); // soft reset
		EPD_WaitUntilIdle();

		EPD_SendCommand(0x74); //set analog block control
		EPD_SendData(0x54);
		EPD_SendCommand(0x7E); //set digital block control
		EPD_SendData(0x3B);

		EPD_SendCommand(0x01); //Driver output control
		EPD_SendData(0xF9);
		EPD_SendData(0x00);
		EPD_SendData(0x00);

		EPD_SendCommand(0x11); //data entry mode
		EPD_SendData(0x01);

		EPD_SendCommand(0x44); //set Ram-X address start/end position
		EPD_SendData(0x00);
		EPD_SendData(0x0F);    //0x0C-->(15+1)*8=128

		EPD_SendCommand(0x45); //set Ram-Y address start/end position
		EPD_SendData(0xF9);   //0xF9-->(249+1)=250
		EPD_SendData(0x00);
		EPD_SendData(0x00);
		EPD_SendData(0x00);

		EPD_SendCommand(0x3C); //BorderWavefrom
		EPD_SendData(0x03);

		EPD_SendCommand(0x2C);     //VCOM Voltage
		EPD_SendData(0x55);    //

		EPD_SendCommand(0x03);
		EPD_SendData(lut_full_update[70]);

		EPD_SendCommand(0x04); //
		EPD_SendData(lut_full_update[71]);
		EPD_SendData(lut_full_update[72]);
		EPD_SendData(lut_full_update[73]);

		EPD_SendCommand(0x3A);     //Dummy Line
		EPD_SendData(lut_full_update[74]);
		EPD_SendCommand(0x3B);     //Gate time
		EPD_SendData(lut_full_update[75]);

		EPD_SendCommand(0x32);
		for(count = 0; count < 70; count++)
			EPD_SendData(lut_full_update[count]);

		EPD_SendCommand(0x4E);   // set RAM x address count to 0;
		EPD_SendData(0x00);
		EPD_SendCommand(0x4F);   // set RAM y address count to 0X127;
		EPD_SendData(0xF9);
		EPD_SendData(0x00);
		EPD_WaitUntilIdle();
	} else {
		EPD_SendCommand(0x2C);     //VCOM Voltage
		EPD_SendData(0x26);

		EPD_WaitUntilIdle();

		EPD_SendCommand(0x32);
		for(count = 0; count < 70; count++)
			EPD_SendData(lut_partial_update[count]);

		EPD_SendCommand(0x37);
		EPD_SendData(0x00);
		EPD_SendData(0x00);
		EPD_SendData(0x00);
		EPD_SendData(0x00);
		EPD_SendData(0x40);
		EPD_SendData(0x00);
		EPD_SendData(0x00);

		EPD_SendCommand(0x22);
		EPD_SendData(0xC0);
		EPD_SendCommand(0x20);
		EPD_WaitUntilIdle();

		EPD_SendCommand(0x3C); //BorderWavefrom
		EPD_SendData(0x01);
	}
	return 0;
}

/******************************************************************************
function :	send command
parameter:Reg : Command register
 ******************************************************************************/
void EPD_SendCommand(unsigned char Reg)
{
	spi_transfer_t xfer= {0};
	xfer.txData   = &Reg;
	xfer.rxData   = dest_Buff;
	xfer.dataSize = 1;
	EPD_SetCommandMode();
	SPI_MasterTransferBlocking(SPI1, &xfer);
}

/******************************************************************************
function :	send command
parameter:Reg : Command register
 ******************************************************************************/
void EPD_SendData(unsigned char Data)
{
	spi_transfer_t xfer= {0};
	xfer.txData   = &Data;
	xfer.rxData   = dest_Buff;
	xfer.dataSize = 1;
	EPD_SetDataMode();
	SPI_MasterTransferBlocking(SPI1, &xfer);
}
/******************************************************************************
function :	send command
parameter:Reg : Command register
 ******************************************************************************/
void EPD_SetCommandMode(void)
{
	GPIO_PortClear(BOARD_INITPINS_DP_DC_GPIO, 1u << BOARD_INITPINS_DP_DC_PIN);
}

/******************************************************************************
function :	send command
parameter:Reg : Command register
 ******************************************************************************/
void EPD_SetDataMode(void)
{
	GPIO_PortSet(BOARD_INITPINS_DP_DC_GPIO, 1u << BOARD_INITPINS_DP_DC_PIN);
}

/******************************************************************************
function :	Software reset
parameter:
 ******************************************************************************/
void EPD_Reset(void)
{
	PRINTF("Reset e-paper\n\r");
	GPIO_PortSet(BOARD_INITPINS_DP_RST_GPIO, 1u << BOARD_INITPINS_DP_RST_PIN);
	GPIO_PortClear(BOARD_INITPINS_DP_RST_GPIO, 1u << BOARD_INITPINS_DP_RST_PIN);
	GPIO_PortSet(BOARD_INITPINS_DP_RST_GPIO, 1u << BOARD_INITPINS_DP_RST_PIN);
}

/******************************************************************************
function :	Wait until the busy_pin goes LOW
parameter:
 ******************************************************************************/
void EPD_WaitUntilIdle(void)
{
	PRINTF("e-Paper busy\r\n");
	while(GPIO_PinRead(BOARD_INITPINS_DP_BUSY_GPIO, BOARD_INITPINS_DP_BUSY_PIN) == 1) {      //LOW: idle, HIGH: busy
		//DEV_Delay_ms(100);
	}
	PRINTF("e-Paper busy release\r\n");
}

/******************************************************************************
function :	Turn On Display
parameter:
 ******************************************************************************/
void EPD_TurnOnDisplay(void)
{
	EPD_SendCommand(0x22); // DISPLAY_UPDATE_CONTROL_2
	EPD_SendData(0xC7);
	EPD_SendCommand(0X20);	// MASTER_ACTIVATION

	EPD_WaitUntilIdle();
}

void EPD_SetWindows(int x_start, int y_start, int x_end, int y_end)
{
	EPD_SendCommand(0x44);
	/* x point must be the multiple of 8 or the last 3 bits will be ignored */
	EPD_SendData((x_start >> 3) & 0xFF);
	EPD_SendData((x_end >> 3) & 0xFF);
	EPD_SendCommand(0x45);
	EPD_SendData(y_start & 0xFF);
	EPD_SendData((y_start >> 8) & 0xFF);
	EPD_SendData(y_end & 0xFF);
	EPD_SendData((y_end >> 8) & 0xFF);
}

void EPD_SetCursor(int x, int y)
{
	EPD_SendCommand(0x4E);
	/* x point must be the multiple of 8 or the last 3 bits will be ignored */
	EPD_SendData((x >> 3) & 0xFF);
	EPD_SendCommand(0x4F);
	EPD_SendData(y & 0xFF);
	EPD_SendData((y >> 8) & 0xFF);
	//    EPD_WaitUntilIdle();
}

/******************************************************************************
function :	Clear screen
parameter:
 ******************************************************************************/
void EPD_Clear(void)
{
	unsigned char Width, Height;
	Width = (EPD_WIDTH % 8 == 0)? (EPD_WIDTH / 8 ): (EPD_WIDTH / 8 + 1);
	Height = EPD_HEIGHT;
	EPD_SendCommand(0x24);
	for (unsigned char j = 0; j < Height; j++) {
		for (unsigned char i = 0; i < Width; i++) {
			EPD_SendData(0XFF);
		}
	}
	EPD_TurnOnDisplay();
}

/******************************************************************************
function :	Sends the image buffer in RAM to e-Paper and displays
parameter:
 ******************************************************************************/
void EPD_Display(unsigned char *Image)
{
	unsigned char Width, Height;
	Width = (EPD_WIDTH % 8 == 0)? (EPD_WIDTH / 8 ): (EPD_WIDTH / 8 + 1);
	Height = EPD_HEIGHT;

	EPD_SendCommand(0x24);
	for (unsigned char j = 0; j < Height; j++) {
		for (unsigned char i = 0; i < Width; i++) {
			EPD_SendData(Image[i + j * Width]);
		}
	}
	EPD_TurnOnDisplay();
}



void EPD_Black(void)
{
	unsigned char Width, Height;
	Width = (EPD_WIDTH % 8 == 0)? (EPD_WIDTH / 8 ): (EPD_WIDTH / 8 + 1);
	Height = EPD_HEIGHT;
	EPD_SendCommand(0x24);
	for (unsigned char j = 0; j < Height; j++) {
		for (unsigned char i = 0; i < Width; i++) {
			EPD_SendData(0XFF);
		}
	}
	EPD_TurnOnDisplay();
}
/******************************************************************************
function :	Enter sleep mode
parameter:
 ******************************************************************************/
void EPD_Sleep(void)
{
	EPD_SendCommand(0x10); //DEEP_SLEEP_MODE
	EPD_SendData(0x01);
}

